About: Four of the most explosive porno starlets of their day come together for this eyebrow-raising tale of lust that stays all in the family. Yes, it's another incest-driven romp from the mid-80's, a time when seemingly everyone was getting down and dirty with their siblings. At least, that is, if you believe what you see in porno flicks of the time. In this 1985 opus, we get to watch the endlessly amorous antics of a family that just can't get enough hardcore action. In fact, this family is so sex-mad that they're delving into a whole lot of rump-humping hysterics
